import React, { Component } from "react";
import RangeBarChart from "./views/column charts/Range Bar Chart";
import { Switch, Route } from "react-router";

export default class Login extends Component {
    clickfunc = () => {
        <Switch>
            <Route exact path='/topology' component={RangeBarChart} />
        </Switch>
    }

    render() {
        return (
            <form>
                <h3>Sign In</h3>

                <div className="form-group">
                    <label>Email address</label>
                    <input type="email" className="form-control" placeholder="Enter email" />
                </div>

                <div className="form-group">
                    <label>Password</label>
                    <input type="password" className="form-control" placeholder="Enter password" />
                </div>

                <div className="form-group">
                    <div className="custom-control custom-checkbox">
                        <input type="checkbox" className="custom-control-input" id="customCheck1" />
                        <label className="custom-control-label" htmlFor="customCheck1">Remember me</label>
                    </div>
                </div>

                <button type="submit" className="btn btn-primary btn-block" onClick={this.clickfunc}>Submit</button>
                <p className="forgot-password text-right">
                     <a href="#">Forgot password?</a>
                </p>
            </form>
        );
    }
}
